import React,{ useState } from 'react';

// const state = useState();


function AppHook(){

    const[count, setCount] = useState(10);

    const IncVal = () => {

        useState(count + 1);
        console.log('hi');


    };

    return (
        <>
            <h1>{count}</h1>
            <button onClick={IncVal}>Click Me</button>
        </>
    );
};

export default AppHook;
